Let's design a computational model to predict responder acceptance behavior in this bargaining game.  The key psychological mechanisms likely at play include:

1. **Fairness:** Responders are likely sensitive to the fairness of the proposed split, considering both the absolute amounts and the proportional shares relative to the contributions (tokens) of each player.  Perceived fairness will heavily influence the acceptance decision.

2. **Self-Interest:** Responders will prioritize maximizing their own monetary gain.  A higher proposed amount will naturally increase the likelihood of acceptance.

3. **Relative Contribution:** The ratio of the responder's contribution to the opponent's contribution likely influences the perception of fairness. A responder who contributed significantly more might expect a larger share to be considered fair.

4. **Risk Aversion:** Responders might be risk-averse, preferring a smaller but guaranteed payoff to a larger payoff with a risk of rejection and zero gain.


Considering these mechanisms, a model incorporating both absolute and relative factors is needed.  A multiplicative interaction term can capture the interaction between fairness and self-interest, allowing for flexibility.  We can also include the risk of rejection (i.e., the potential loss of zero) to capture risk aversion.


To address parameter identifiability and multicollinearity concerns, we will minimize the number of learnable parameters. Instead of separate parameters for absolute and relative fairness, we use one parameter that weights the fairness and self-interest features.

This model is structured as a utility function, where a higher utility score indicates a greater likelihood of accepting the offer. The model then uses a logistic function to translate utility into a probability of acceptance.

<MODEL>
U = α * (split_self + β * (split_self / combined_earning) * (token_self / token_opp)) - γ * (combined_earning - split_self)

P(accept = 1) = 1 / (1 + exp(-U))
</MODEL>

